import React from 'react';

function ReceiveOrders() {
  return (
    <div>
      <h2>Receive Orders</h2>
      <ul>
        <li>View New Orders</li>
        <li>Process & Dispatch</li>
      </ul>
    </div>
  );
}

export default ReceiveOrders;
